import React, { Component } from 'react';
import "./index.css";

class Speaker extends Component {
  render() {
    return (
      <div className="contentDiv">
        <p id="speakerTitle">Jonathan Thompson</p>
        <div className="row">
          <div className="col s12 m6">
            <img src="./images/face.jpg"></img>
          </div>
          <div className="col s12 m6">
          </div>
        </div>
      </div>
    )
  };
};

export default Speaker;
